import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import '../../default.css';
class InfoSession extends Component {

    render() {
        return (

        <div>
            <div class="title">
                <h1> Host an Information Session </h1>
            </div>
            <div class="container">
                <p> The Cornell Society of Women Engineers plans, coordinates, and advertises
                interactive sessions for Cornell Engineering students to meet with visiting corporations.
                These sessions provide students with opportunites to meet company representatives in an informal setting and
                are avenues for companies to recruit students for permanent and internship positions, increasing
                company recognition among students. They are open to all students on campus. </p>
                <p> For those interested in hosting information sessions, please see our <strong> Company Recruiter Brochure </strong> and our <strong>
                FAQ</strong>. To host an information session, please click on the following button. </p>
                <div class="host_button">
                    <Button variant="light" size ="lg">Host an Information Session</Button>
                </div>
                <p> For questions regarding company informations, please contact the Corporate Relations directors at <strong>cornell.swe.cr@gmail.com</strong>.
                The SWE office is located at 162 Olin Hall, Ithaca, NY 14853.</p>
            </div>
        </div>
        );
    }
}

export default InfoSession;
